import numpy as np

def translate_schedule_to_string(matrix, colors):
    schedule_commands = []
    color_index = 0
    for order, row in enumerate(matrix, start=1):
        if np.any(row):  # Check if the order has any scheduled timeslot
            start_timeslots = np.where(np.diff(row, prepend=0) == 1)[0] + 1  # Find start times
            end_timeslots = np.where(np.diff(row, append=0) == -1)[0] + 1  # Find end times

            for start, end in zip(start_timeslots, end_timeslots):
                color = colors[color_index % len(colors)]
                color_index += 1
                command = f"\\addplot[color={color}, mark=*] coordinates {{({start}, {order}) ({end}, {order})}};"
                schedule_commands.append(command)

    return '\n'.join(schedule_commands)

