def convert_text_to_matrix(text):
    # Split the text into separate lists. Each list is between square brackets.
    lists = text.strip().split(']\n             ')

    # Initialize an empty list to store the processed rows
    matrix = []

    for lst in lists:
        # Remove any leading/trailing square brackets and split the string into numbers
        cleaned_list = lst.strip('[]').split()

        # Convert the string numbers into integers and add to the matrix
        matrix.append([int(num) for num in cleaned_list])

    return np.array(matrix)
